et.com>','New features in Front','2014-07-08 22:53:36',15685,'fbcee972f113b04b5d73bc3beedea2f9b89b9fc1e364edce95928dfc6580e28e',0,0,0,NULL,'<!DOCTYPE HTML>\n<html lang=\"en\">\n<head>\n<meta content=\"text/html; charset=utf-8\" http-equiv=\"Content-Type\">\n<title>New features in Front</title>\n<link rel=\"image_src\" href=\"http://r.frontapp.com/nlt/038k/00kzm.png\">\n<style type=\"text/css\">\n					a { border: none; }\n					img { border: none; }\n					p { margin: 0; line-height: 1.3em; }\n					#footer-msg a { color: #F3A836; }\n					h1,h2,h3,h4,h5,h6 {font-size:100%;margin:0;}\n				</style>\n</head>\n<body style=\"margin: 0; padding: 0; background-color: #eeeeee\" bgcolor=\"#eeeeee\">\n				\n				<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" align=\"center\" width=\"100%\"><tr>\n<td align=\"center\" style=\"padding: 37px 0; background-color: #eeeeee;\" bgcolor=\"#eeeeee\">\n<div style=\"padding: 0 0 10px\"><a href=\"http://r.frontapp.com/nl/038k/00kzm.html?a=9Awvh2&amp;b=b2b6b217&amp;c=038k&amp;d=dc05b522&amp;e=672f8f42&amp;email=inboxapptest%40gmail.com\" style=\"line-height: 1;vertical-align: bottom;color: #000000; font-family: arial; font-size: 11px; ;border: none;\">View online version</a></div>\n			 <!-- #nl_container -->\n			 <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" style=\"margin: 0; border: 1px solid #dddddd; color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; \" width=\"600\"><tr>\n<td>\n			 \n			 <!-- #nl_header -->\n			 <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\"><tr>\n<td>\n			 \n			 </td>\n			 </tr></table>\n<!-- #nl_content --><table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" style=\"margin: 0; border-collapse: collapse;\" width=\"100%\"><tr>\n<td style=\"color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; padding: 5px 0;\" align=\"left\">\n<table style=\"margin: 0 0 0 10px;border-collapse:collapse;color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; \"><tr><td width=\"580\" style=\"vertical-align: top; padding: 5px 0; \"><table cellpadding=\"0\" cellspacing=\"0\" style=\"border-collapse:collapse;width:565px;color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; \" width=\"565\"><tr><td style=\"padding:5px 0 5px 5px;line-height:normal;color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; \">\n <p style=\"margin: 0 0 10px;line-height: 1.3em;\"><span style=\"font-size: 13px; line-height: normal; font-family: Arial;\">Hi there!</span><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><span style=\"font-size: 13px; line-height: normal; font-family: Arial;\">We\'ve released a new improved version of Front with 3 new features. Here they are. </span><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><span style=\"font-size: 13px; line-height: normal; font-family: Arial;\"><b>1. Automated Rules</b></span><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><span style=\"font-size: 13px; line-height: normal; font-family: Arial;\">You can now use rules to trigger automated actions on incoming conversations (auto-assign, auto-reply, auto-tag, etc.). </span>Here\'s a quick <a href=\"https://www.youtube.com/watch?v=hI1O3hxFmP4&amp;feature=youtu.be\" style=\"color: #0033cc; ;border: none;\">video tutorial</a>&nbsp;on how to use them.<br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><span style=\"font-size: 13px; line-height: normal; font-family: Arial;\">This feature will only be available in the enterprise plan (19$/user/month) we\'ll be releasing at the end of the week. However, you can give them try whatever your plan is in your settings panel. </span><br><br><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><span style=\"font-size: 13px; line-height: normal; font-family: Arial;\"><b>2. History of a contact</b></span><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><span style=\"font-size: 13px; line-height: normal; font-family: Arial;\">You can now see all the previous conversations you had with a contact by simply clicking on his name in Front. </span></p> \n </td></tr></table></td></tr></table>\n<table style=\"margin: 0 0 0 10px;border-collapse:collapse;color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; \"><tr><td width=\"580\" style=\"vertical-align: top; padding: 5px 0; \"><div style=\"padding: 6px; text-align: center;\"><img alt=\"\" width=\"568\" height=\"372\" style=\"display: block; margin: 0 auto;border: none;\" src=\"http://r.frontapp.com/img/038k/00kug/xhw64.png\"></div></td></tr></table>\n<table style=\"margin: 0 0 0 10px;border-collapse:collapse;color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; \"><tr><td width=\"580\" style=\"vertical-align: top; padding: 5px 0; \"><table cellpadding=\"0\" cellspacing=\"0\" style=\"border-collapse:collapse;width:565px;color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; \" width=\"565\"><tr><td style=\"padding:5px 0 5px 5px;line-height:normal;color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; \">\n \n \n <p style=\"margin: 0 0 10px;line-height: 1.3em;\"><span style=\"font-size: 13px; line-height: normal; font-family: Arial;\"><b>3. Twitter profile</b></span><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><span style=\"font-size: 13px; line-height: normal; font-family: Arial;\">You now have access to the Twitter profile (bio, number of tweets, followers, following) of every person who mentions your company in a tweet. </span><br></p> \n \n \n </td></tr></table></td></tr></table>\n<table style=\"margin: 0 0 0 10px;border-collapse:collapse;color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; \"><tr><td width=\"580\" style=\"vertical-align: top; padding: 5px 0; \"><div style=\"padding: 6px; text-align: center;\"><img alt=\"\" width=\"568\" height=\"372\" style=\"display: block; margin: 0 auto;border: none;\" src=\"http://r.frontapp.com/img/038k/00kug/xhw6o.png\"></div></td></tr></table>\n<table style=\"margin: 0 0 0 10px;border-collapse:collapse;color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; \"><tr><td width=\"580\" style=\"vertical-align: top; padding: 5px 0; \"><table cellpadding=\"0\" cellspacing=\"0\" style=\"border-collapse:collapse;width:565px;color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; \" width=\"565\"><tr><td style=\"padding:5px 0 5px 5px;line-height:normal;color: #444444; font-family: arial; font-size: 12px; border-color: #dddddd; background-color: #ffffff; \">\n <p style=\"margin: 0 0 10px;line-height: 1.3em;\"><span style=\"font-family: Arial; font-size: 13px; line-height: normal; color: rgb(34, 34, 34); background-color: rgb(255, 255, 255);\">We\'ve also made a few improvements on the rest of the app.</span></p>\n<p style=\"margin: 0 0 10px;line-height: 1.3em;\"><br style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><span style=\"font-size: 13px; line-height: normal; font-family: Arial;\">- The email address of the person you\'re replying too is displayed next to the contact\'s name. </span><br><span style=\"font-size: 13px; line-height: normal; font-family: Arial;\">- If you click on a notification on your phone, you will be redirected to the mobile app.<br>- The snooze function has been improved! </span></p>\n<div style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><br></div>\n<div style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\"><font face=\"Arial\">Please let us know if you have any question or comment.<br><br>Cheers!</font></div>\n<div style=\"font-family: arial, sans-serif; font-size: 13px; line-height: normal;\">\n<br><font face=\"Arial\">Mathilde</font>\n</div> \n </td></tr></table></td></tr></table>\n</td>\n			 </tr></table>\n</td>\n			 </tr></table>\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" height=\"10\" style=\"height: 10px;border-collapse: collapse;font-size: 1px;\"><tr><td height=\"10\" style=\"height:10px; border-spacing: 0;font-size: 1px;\">&nbsp;</td></tr></table>\n<table cellpadding=\"10\" cellspacing=\"0\" border=\"0\" style=\"margin: 0; border-collapse: collapse;\" width=\"600\"><tr>\n<td style=\"color: #444444; background-color: #eeeeee; border-color: #eeeeee; align: left; font-family: arial; font-size: 11px; \">\n			 					<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" style=\"width: 100%; margin: 0; border-collapse: collapse;\" width=\"100%\"><tr>\n<td align=\"left\" valign=\"top\" style=\"vertical-align: top; text-align: left; color: #444444; background-color: #eeeeee; border-color: #eeeeee; align: left; font-family: arial; font-size: 11px; \">\n					<div id=\"nl_footer\" style=\"display: block; text-align: left; margin: 0;\">This email has been sent to <a href=\"mailto:inboxapptest@gmail.com\" style=\"color:#000000;border: none;\">inboxapptest@gmail.com</a>, <a href=\"http://r.frontapp.com/unsub?hl=en&amp;a=9Awvh2&amp;b=b2b6b217&amp;c=038k&amp;d=dc05b522&amp;e=672f8f42&amp;email=inboxapptest%40gmail.com\" style=\"color:#000000;border: none;\">click here to unsubscribe</a>.</div>\n					<div id=\"footer_address\" style=\"display: block; text-align: left; margin: 5px 0 0;\"></div>\n				</td>\n				<td align=\"right\" valign=\"top\" style=\"vertical-align: top; text-align: right\">\n					<a href=\"http://www.mailjet.com\" style=\"border: none;border: none;\"><img class=\"nl_footer_logo\" alt=\"\" style=\"border: none;\" src=\"http://www.mailjet.com/images/theme/v1/logos/nl_logo.png\"></a>\n				</td>\n		 	\n			 						</tr></table>\n</td>\n							</tr></table>\n</td>\n			 </tr></table>\n\n<br/><img src=\"http://r.frontapp.com/o/038k/eb545d5c/5xtv3mie.gif\" height=\"1\" width=\"1\" alt=\"\" border=\"0\" />\n</body>\n</html>','View online version Hi there! We\'ve released a new improved version of Front with 3 new features. Here they are. 1. Automated Rules You can now use rules to trigger automated actions on incom',55,0,1473102496162753838,1473102496162753838,NULL,'[]',0,0,NULL,NULL),('zt»ﬂ ›F⁄êxˇ“ˆ\';b','2015-05-06 21:05:52','2015-05-06 21:05:52',NULL,13,13,1,'[[\"Mathilde Collin\", \"mathilde.collin@front.mail.intercom.io\"]]','[[\"\", \"mathilde.collin=front.mail.intercom.io@mail.intercom.io\"]]','[[\"Reply to Mathilde Collin\", \"mathilde.collin@front.mail.intercom.io\"]]','[[\"\", \"inboxapptest@gmail.com\"]]','[]','[]',NULL,'<925d78ef-0a43b873-1404494563-438022646@mail.intercom.io>','Front - Your trial has just ended','2014-07-04 17:22:48',6034,'6a5763bdc30a6387ec14dbe202db9d2ba75ca8aece0868abdaedde2b159d0172',0,0,0,NULL,'<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n  \n</head>\n<body class=\"email_preview\">\n  <div class=\"js_contains_rich_message_editor js_primary_editor\">\n    <div>\n      <p style=\"margin-top: 0\">Hi there,</p>\n\n<p style=\"margin-top: 0\">Your free trial has just ended!</p>\n\n<p style=\"margin-top: 0\">Your account is now a free plan with a limit of 200 incoming messages per month. </p>\n\n<p style=\"margin-top: 0\">If this plan is not enough for you, simply upgrade to our premium plan at $9/month/user and get unlimited emails, unlimited inboxes, and analytics!</p>\n\n<p style=\"margin-top: 0\">If you have any questions about our premium plans, feel free to ask - I\'d be happy to help.</p>\n\n<p style=\"margin-top: 0\">Have a great day, <br>\nMathilde</p>\n    </div>\n\n\n      <div class=\"footer_links\" style=\"margin-top: 2em\">\n        <p style=\"margin-top: 0\"><a href=\"https://app.intercom.io/unsubscribe?app_id=7a753d271446f8883ba3daee369dc93c3357bc95&amp;conversation_id=438022646&amp;user_id=53a464e7fcdab60f340079ff\">Unsubscribe from our emails</a></p>\n      </div>\n  </div>\n<img src=\"https://via.intercom.io/o?h=9fd3318d2e10d9016060ec7d9538492a3a2006a7-438022646\" width=\"1\" height=\"1\" style=\"display: block;\">\n</body>\n</html>','Hi there, Your free trial has just ended! Your account is now a free plan with a limit of 200 incoming messages per month. If this plan is not enough for you, simply upgrade to our premium pl',59,0,1472719296951215812,1472719296951215812,NULL,'[]',0,0,NULL,NULL),('|–3ZdRF\"ßî◊FP9˙«','2015-05-06 21:05:53','2015-05-06 21:05:55',NULL,14,14,1,'[[\"kavya joshi\", \"kavya719@gmail.com\"]]','[]','[]','[[\"\", \"inboxapptest@gmail.com\"]]','[]','[]','\"<2D4C6F7D-59F9-4B12-8BEF-3C60556AEC7E@gmail.com>\"','<CAMpoCYqq6BmoRW+MouXOwDxiA=DO20b=sG4e2agmr04Bt8Wg_g@mail.gmail.com>','Fwd: Golden Gate Park next Sat','2014-04-24 08:58:04',13142,'a5993aef718c4ce3ffd93f0a3cf3a4e54f93278bcb5873a533de3882c383e706',0,0,0,NULL,'<div dir=\"ltr\"><br><br><div class=\"gmail_quote\">---------- Forwarded message ----------<br>From: <b class=\"gmail_sendername\">Erika Bildsten Reinhardt</b> <span dir=\"ltr\">&lt;<a href=\"mailto:embreinhardt@gmail.com\">embreinhardt@gmail.com</a>&gt;</span><br>\nDate: Sat, Apr 19, 2014 at 10:55 AM<br>Subject: Re: Golden Gate Park next Sat<br>To: Vivian Dien &lt;<a href=\"mailto:vivian.dien@gmail.com\">vivian.dien@gmail.com</a>&gt;<br>Cc: Wei Wu &lt;<a href=\"mailto:wuhuwei@gmail.com\">wuhuwei@gmail.com</a>&gt;, Sarah Bindman &lt;<a href=\"mailto:sarahbindman@gmail.com\">sarahbindman@gmail.com</a>&gt;, Samuel Thompson &lt;<a href=\"mailto:keleayon@gmail.com\">keleayon@gmail.com</a>&gt;, kavya joshi &lt;<a href=\"mailto:kavya719@gmail.com\">kavya719@gmail.com</a>&gt;, Sahar El Abbadi &lt;<a href=\"mailto:elabbadi@stanford.edu\">elabbadi@stanford.edu</a>&gt;<br>\n<br><br><div dir=\"auto\"><div>I&#39;m here on the western side of the meadow near the volleyball setups<br><br>Sent from my iPhone</div><div><div class=\"h5\"><div><br>On Apr 19, 2014, at 10:38 AM, Vivian Dien &lt;<a href=\"mailto:vivian.dien@gmail.com\" target=\"_blank\">vivian.dien@gmail.com</a>&gt; wrote:<br>\n<br></div><blockquote type=\"cite\"><div>Ah running late too but &nbsp;will be there with coconut almond date bars!<span></span><div><br>On Saturday, April 19, 2014, Wei Wu &lt;<a href=\"mailto:wuhuwei@gmail.com\" target=\"_blank\">wuhuwei@gmail.com</a>&gt; wrote:<br>\n<blockquote class=\"gmail_quote\" style=\"margin:0 0 0 .8ex;border-left:1px #ccc solid;padding-left:1ex\">\n<div dir=\"ltr\">I&#39;ll be there, also with fruit, whatever I find at the farmer&#39;s market on the way, and a friend!<div><br></div><div>-- Wei</div></div><div><br><br><div>On Sat, Apr 19, 2014 at 9:36 AM, Sarah Bindman <span dir=\"ltr\">&lt;<a>sarahbindman@gmail.com</a>&gt;</span> wrote:<br>\n\n\n\n<blockquote style=\"margin:0 0 0 .8ex;border-left:1px #ccc solid;padding-left:1ex\"><div dir=\"ltr\">Knowing me I&#39;ll probably be a little late but I should be there by 11:30 and will bring fruit!</div>\n\n<div><div><div><br><br><div>On Sat, Apr 19, 2014 at 3:03 AM, Samuel Thompson <span dir=\"ltr\">&lt;<a>keleayon@gmail.com</a>&gt;</span> wrote:<br>\n\n\n\n<blockquote style=\"margin:0 0 0 .8ex;border-left:1px #ccc solid;padding-left:1ex\"><div style=\"word-wrap:break-word\">Hi everyone,<div><br></div><div>I am feeling a little under the weather, and I am having trouble sleeping, so I probably will have to pass tomorrow.</div>\n\n\n\n\n\n<div><br></div><div>Sorry to miss!</div><div><div><div><div>On Apr 18, 2014, at 5:42 PM, Vivian Dien &lt;<a>vivian.dien@gmail.com</a>&gt; wrote:</div><br><blockquote type=\"cite\">\n\n\n\n<div dir=\"ltr\">Awesome!<div>I&#39;ll bring some yummy treats too :)</div></div><div><br><br><div>On Fri, Apr 18, 2014 at 5:34 PM, Erika Reinhardt <span dir=\"ltr\">&lt;<a>embreinhardt@gmail.com</a>&gt;</span> wrote:<br>\n\n\n\n\n\n<blockquote style=\"margin:0 0 0 .8ex;border-left:1px #ccc solid;padding-left:1ex\"><div dir=\"ltr\">Sure - see you at 11. I&#39;ll bring cheese, baguette and a picnic blanket!</div><div><div>\n\n<div><br><br><div>On Fri, Apr 18, 2014 at 5:33 PM, Vivian Dien <span dir=\"ltr\">&lt;<a>vivian.dien@gmail.com</a>&gt;</span> wrote:<br>\n\n\n\n\n\n\n<blockquote style=\"margin:0 0 0 .8ex;border-left:1px #ccc solid;padding-left:1ex\"><div dir=\"ltr\">Hey!&nbsp;<div><br></div><div>So our volleyball group is thinking about setting up at Lindley Meadow where there is lots of nice flat space.. Does this work for you guys?</div>\n\n\n\n\n\n\n\n\n<div><a href=\"https://goo.gl/maps/gJqVc\" target=\"_blank\">https://goo.gl/maps/gJqVc</a><br>\n\n</div></div><div><div><br><br><div>On Wed, Apr 16, 2014 at 3:34 PM, kavya joshi <span dir=\"ltr\">&lt;<a>kavya719@gmail.com</a>&gt;</span> wrote:<br>\n\n\n\n\n\n\n\n\n<blockquote style=\"margin:0 0 0 .8ex;border-left:1px #ccc solid;padding-left:1ex\"><div dir=\"ltr\">I&#39;ll try to make it!<div>I&#39;ll know what my weekend work schedule is tomorrow, and will confirm either way then.</div>\n\n\n\n\n\n\n\n\n\n\n</div><div><div><br><br><div>On Wed, Apr 16, 2014 at 11:32 AM, Erika Reinhardt <span dir=\"ltr\">&lt;<a>embreinhardt@gmail.com</a>&gt;</span> wrote:<br>\n\n\n\n\n\n\n\n\n\n<blockquote style=\"margin:0 0 0 .8ex;border-left:1px #ccc solid;padding-left:1ex\"><div dir=\"ltr\">Perfect!</div><div><div><br><br><div>\nOn Wed, Apr 16, 2014 at 10:03 AM, Sarah Bindman <span dir=\"ltr\">&lt;<a>sarahbindman@gmail.com</a>&gt;</span> wrote:<br>\n<blockquote style=\"margin:0 0 0 .8ex;border-left:1px #ccc solid;padding-left:1ex\"><div dir=\"ltr\">Why don&#39;t we do a picnic brunch! I think that might work best with coordinating volleyball. How about 11 if the sun is out.</div>\n\n\n\n\n\n\n\n\n\n\n\n\n<div><div><br><br><div>On Tue, Apr 15, 2014 at 11:39 PM, Erika Reinhardt <span dir=\"ltr\">&lt;<a>embreinhardt@gmail.com</a>&gt;</span> wrote:<br>\n\n\n\n\n\n\n\n\n\n\n\n\n<blockquote style=\"margin:0 0 0 .8ex;border-left:1px #ccc solid;padding-left:1ex\"><div dir=\"ltr\">I&#39;m free all day!</div><div><div><br><br><div>\n\nOn Tue, Apr 15, 2014 at 3:54 PM, Vivian Dien <span dir=\"ltr\">&lt;<a>vivian.dien@gmail.com</a>&gt;</span> wrote:<br>\n<blockquote style=\"margin:0 0 0 .8ex;border-left:1px #ccc solid;padding-left:1ex\"><div dir=\"ltr\">What time is good for you guys??</div><div><br><br><div><div>\nOn Tue, Apr 15, 2014 at 10:14 AM, Vivian Dien <span dir=\"ltr\">&lt;<a></a></span></div></div></div></blockquote></div></div></div></blockquote></div></div></div></blockquote></div></div></div></blockquote></div></div></div>\n\n</blockquote></div></div></div></blockquote></div></div></div></div></blockquote></div></div></blockquote></div></div></div></div></blockquote></div></div></div></div></blockquote></div></div></blockquote></div><br><br>-- <br>\n\nVivian Dien<br><blockquote style=\"margin-top:0px;margin-right:0px;margin-bottom:0px;margin-left:40px;border-top-style:none;border-right-style:none;border-bottom-style:none;border-left-style:none;border-width: