" width=\"64\"><img alt=\"\" src=\"https://ssl.gstatic.com/drive/announcements/images/framework-top-left.png\" height=\"51\" width=\"64\" style=\"display:block\" /></td>\n        <td background=\"https://ssl.gstatic.com/drive/announcements/images/framework-top-middle.png\" bgcolor=\"#f5f5f5\" height=\"51\" valign=\"bottom\" width=\"673\">\n\n        </td>\n        <td height=\"51\" width=\"64\"><img alt=\"\" src=\"https://ssl.gstatic.com/drive/announcements/images/framework-top-right.png\" height=\"51\" width=\"68\" style=\"display:block\" /></td>\n        <td>&nbsp;</td>\n      </tr>\n      <tr>\n        <td>&nbsp;</td>\n        <td height=225 width=\"64\"><img alt=\"\" src=\"https://ssl.gstatic.com/drive/announcements/images/framework-middle-1-left.png\" height=225 width=\"64\" style=\"display:block\" /></td>\n        <td width=\"668\" bgcolor=\"#ffffff\" valign=\"top\">\n          <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" style=\"border-collapse: collapse; \">\n            <tr>\n              <td colspan=\"3\">&nbsp;</td>\n            </tr>\n            <tr>\n              <td align=\"center\" colspan=\"3\" height=50 valign=bottom><img alt=\"\" src=\"https://ssl.gstatic.com/drive/announcements/images/logo.gif\" style=\"display:block\" /></td>\n            </tr>\n            <tr>\n              <td colspan=\"3\" height=40>&nbsp;</td>\n            </tr>\n            <tr>\n              <td>&nbsp;</td>\n              <td width=\"450\" >\n                  <b>\n                    <font face=\"Arial, sans-serif\" color=\"#444444\" size=\"-1\" style=\"line-height: 1.4em\">\n                      <img alt=\"\" src=\"https://ssl.gstatic.com/accounts/services/mail/msa/gmail_icon_small.png\" style=\"display:block;float:left;margin-top:4px;margin-right:3px;\" />Hi Inbox\n                    </font>\n                  </b>\n              </td>\n              <td>&nbsp;</td>\n            </tr>\n            <tr>\n              <td valign=top height=40>\n            </tr>\n<tr>\n              <td width=\"111\">&nbsp;</td>\n              <td align=\"left\">\n                <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"540\" style=\"border-collapse: collapse;\">\n                  <tr>\n                    <td valign=\"top\"><font face=\"Arial, sans-serif\" color=\"#444444\" size=\"+2\"><span style=\"font-family:Open Sans, Arial, sans-serif; font-size: 25px\">Tips for using Gmail</span></font></td>\n                  </tr>\n                </table>\n              </td>\n              <td width=\"111\">&nbsp;</td>\n            </tr>\n            <tr>\n              <td colspan=3 height=10>&nbsp;</td>\n            </tr>\n          </table>\n        </td>\n        <td height=225 width=\"64\"><img alt=\"\" src=\"https://ssl.gstatic.com/drive/announcements/images/framework-middle-1-right.png\" height=225 width=\"64\" style=\"display:block\" /></td>\n        <td>&nbsp;</td>\n      </tr>\n      <tr>\n        <td>&nbsp;</td>\n        <td height=950 width=\"64\"><img alt=\"\" src=\"https://ssl.gstatic.com/drive/announcements/images/framework-middle-2-left.png\" height=950 width=\"64\" style=\"display:block\" /></td>\n        <td bgcolor=\"#ffffff\" align=\"center\" valign=\"top\" width=\"668\">\n          <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"540\" style=\"border-collapse: collapse;\">\n\n            <tr>\n              <td align=\"left\">\n                <img alt=\"\" src=\"https://ssl.gstatic.com/accounts/services/mail/msa/welcome_hangouts.png\" style=\"display:block\" />\n              </td>\n              <td width=\"15\"></td>\n              <td align=\"left\" valign=middle>\n                <table border=0 cellpadding=0 cellspacing=0 width=400 style=border-collapse:collapse;>\n                  <tr>\n                    <td align=\"left\">\n                      <font face=Arial,sans-serif color=#444444 size=+1><span style=\"font-family:Arial, sans-serif; font-size: 20px;\">Chat right from your inbox</span></font>\n                    </td>\n                  </tr>\n                  <tr>\n                    <td height=\"10\"></td>\n                  </tr>\n                  <tr>\n                    <td align=\"left\" valign=\"top\">\n                      <font face=Arial,sans-serif color=#444444 size=-1 style=line-height:1.4em>Chat with contacts and start video chats with up to 10 people in <a href=\"http://www.google.com/+/learnmore/hangouts/?hl=en\" style=\"text-decoration:none;\">Google+ Hangouts</a>.</font>\n                    </td>\n                  </tr>\n                </table>\n              </td>\n            </tr>\n            <tr>\n              <td colspan=3 height=30>&nbsp;</td>\n            </tr>\n\n            <tr>\n              <td align=\"left\">\n                <img alt=\"\" src=\"https://ssl.gstatic.com/accounts/services/mail/msa/welcome_contacts.png\" style=\"display:block\" />\n              </td>\n              <td width=\"15\"></td>\n              <td align=\"left\" valign=middle>\n                <table border=0 cellpadding=0 cellspacing=0 width=400 style=border-collapse:collapse;>\n                  <tr>\n                    <td align=\"left\">\n                      <font face=Arial,sans-serif color=#444444 size=+1><span style=\"font-family:Arial, sans-serif; font-size: 20px;\">Bring your email into Gmail</span></font>\n                    </td>\n                  </tr>\n                  <tr>\n                    <td height=\"10\"></td>\n                  </tr>\n                  <tr>\n                    <td align=\"left\" valign=\"top\">\n                      <font face=Arial,sans-serif color=#444444 size=-1 style=line-height:1.4em>You can import your email from other webmail to make the transition to Gmail a bit easier. <a href=\"https://support.google.com/mail/answer/164640?hl=en\" style=\"text-decoration:none;\">Learn how.</a></font>\n                    </td>\n                  </tr>\n                </table>\n              </td>\n            </tr>\n            <tr>\n              <td colspan=3 height=30>&nbsp;</td>\n            </tr>\n            <tr>\n              <td align=\"left\">\n                <img alt=\"\" src=\"https://ssl.gstatic.com/mail/welcome/localized/en/welcome_drive.png\" style=\"display:block\" />\n              </td>\n              <td width=\"15\"></td>\n              <td  align=\"left\" valign=middle>\n                <table border=0 cellpadding=0 cellspacing=0 width=400 style=border-collapse:collapse;>\n                  <tr>\n                    <td align=\"left\">\n                      <font face=Arial,sans-serif color=#444444 size=+1><span style=\"font-family:Arial, sans-serif; font-size: 20px;\">Use Google Drive to send large files</span></font>\n                    </td>\n                  </tr>\n                  <tr>\n                    <td height=\"10\"></td>\n                  </tr>\n                  <tr>\n                    <td align=\"left\" valign=\"top\">\n                      <font face=Arial,sans-serif color=#444444 size=-1 style=line-height:1.4em><a href=\"https://support.google.com/mail/answer/2480713?hl=en\" style=\"text-decoration:none;\">Send huge files in Gmail </a>  (up to 10GB) using <a href=\"https://drive.google.com/?hl=en\" style=\"text-decoration:none;\">Google Drive</a>. Plus files stored in Drive stay up-to-date automatically so everyone has the most recent version and can access them from anywhere.</font>\n                    </td>\n                  </tr>\n                </table>\n              </td>\n            </tr>\n            <tr>\n              <td colspan=3 height=30>&nbsp;</td>\n            </tr>\n            <tr>\n              <td align=\"left\">\n                <img alt=\"\" src=\"https://ssl.gstatic.com/accounts/services/mail/msa/welcome_storage.png\" style=\"display:block\" />\n              </td>\n              <td width=\"15\"></td>\n              <td align=\"left\" vali