ckly find the important emails you need with suggestions based on emails, past searches and contacts.</font>\n                    </td>\n                  </tr>\n                </table>\n              </td>\n            </tr>\n            <tr>\n              <td colspan=3 height=30>&nbsp;</td>\n            </tr>\n          </table>\n\n          <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"500\" style=\"border-collapse: collapse; \">\n            <tr>\n              <td colspan=\"2\" height=40>&nbsp;</td>\n            </tr>\n            <tr>\n              <td rowspan=\"2\" width=\"68\"><img alt=\"\" src=\"https://ssl.gstatic.com/accounts/services/mail/msa/gmail_icon_large.png\" style=\"display:block\" /></td>\n              <td height=\"20\" valign=\"bottom\" align=\"left\"><font face=\"Arial, sans-serif\" color=\"#444444\" size=\"-1\">Happy emailing,</font></td>\n            </tr>\n            <tr>\n              <td valign=\"top\" align=\"left\"><font face=\"Arial, sans-serif\" color=\"#444444\" size=\"+2\"><span style=\"font-family:Open Sans, Arial, sans-serif;\">The Gmail Team</span></font></td>\n            </tr>\n            <tr>\n              <td colspan=\"2\" height=60>&nbsp;</td>\n            </tr>\n          </table>\n        </td>\n        <td height=950 width=\"64\"><img alt=\"\" src=\"https://ssl.gstatic.com/drive/announcements/images/framework-middle-2-right.png\" height=950 width=\"64\" style=\"display:block\" /></td>\n        <td>&nbsp;</td>\n      </tr>\n      <tr>\n        <td>&nbsp;</td>\n        <td height=\"102\" width=\"64\"><img alt=\"\" src=\"https://ssl.gstatic.com/drive/announcements/images/framework-bottom-left.png\" height=\"102\" width=\"64\" style=\"display:block\" /></td>\n        <td background=\"https://ssl.gstatic.com/drive/announcements/images/framework-bottom-middle.png\" height=\"102\" valign=\"top\" width=\"673\">\n\n          <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" style=\"bor